32,'_header_subtitle','field_63c5e6b00a2e4'),(3483,32,'header_content','RAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change. We believe digital transformations will revolutionize society, and we’re here as your strategy and tech-for-good partner to drive progress further and faster.'),(3484,32,'_header_content','field_63c5e6b90a2e5'),(3485,160,'custom_css',''),(3486,160,'_custom_css','field_605cafca65108'),(3487,160,'builder_0_layout','Content + Image'),(3488,160,'_builder_0_layout','field_6396a11a1ba71'),(3489,160,'builder_0_content_image_image_side','Right'),(3490,160,'_builder_0_content_image_image_side','field_6398d90ad974d'),(3491,160,'builder_0_content_image_style',''),(3492,160,'_builder_0_content_image_style','field_6396a2011ba75'),(3493,160,'builder_0_content_image_classes',''),(3494,160,'_builder_0_content_image_classes','field_6396a2101ba76'),(3495,160,'builder_0_content_image_content','<h2>Strategists for Good</h2>\r\n<h3>We think boldly about what’s possible</h3>\r\nRAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change.  We believe digital transformations will revolutionize society, and we’re here as your strategy and tech-for-good partner to drive progress further and faster.'),(3496,160,'_builder_0_content_image_content','field_6396a1f01ba73'),(3497,160,'builder_0_content_image_image',''),(3498,160,'_builder_0_content_image_image','field_6396a1fa1ba74'),(3499,160,'builder_0_content_image',''),(3500,160,'_builder_0_content_image','field_6396a1591ba72'),(3501,160,'builder','1'),(3502,160,'_builder','field_6396a0f51ba70'),(3503,160,'header_subtitle','We think boldly about what’s possible'),(3504,160,'_header_subtitle','field_63c5e6b00a2e4'),(3505,160,'header_content','RAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change. We believe digital transformations will revolutionize society, and we’re here as your strategy and tech-for-good partner to drive progress further and faster.'),(3506,160,'_header_content','field_63c5e6b90a2e5'),(3507,32,'builder_0_column_center_style',''),(3508,32,'_builder_0_column_center_style','field_6396a7ab816bd'),(3509,32,'builder_0_column_center_classes',''),(3510,32,'_builder_0_column_center_classes','field_6396a7b5816be'),(3511,32,'builder_0_column_center_content','<h2>Executive Leadership</h2>'),(3512,32,'_builder_0_column_center_content','field_6396a741cad9c'),(3513,32,'builder_0_column_center',''),(3514,32,'_builder_0_column_center','field_6396a732cad9b'),(3515,32,'builder_1_layout','Column Center'),(3516,32,'_builder_1_layout','field_6396a11a1ba71'),(3517,32,'builder_1_two_columns_column_left','<h2>Aimee Dixon</h2>\r\n<h3>Founder, Managing Director</h3>\r\nAimee is an experienced social sector professional working at the intersection of social and environmental impact and strategic philanthropy, both nationally and globally. With over a decade of philanthropic and private capital fundraising experience, she has worked in partnership with senior executive teams on strategic and growth planning, revenue generation, and business development. Aimee was most recently the Director of Philanthropy with World Lacrosse, an International Federation, where she built and led its first development office, directed a capital campaign, and advised a global sustainability working group. Aimee also serves as an independent consultant and advisor for a variety of actors, ranging from agencies in the entertainment industry to small and medium-sized NGOs.\r\n\r\nAimee is a graduate of the University of Louisville, where she earned her degree in Political Science and Sports Business Administration. While there, she was a member of the Women\'s Lacrosse team and earned Big East All-Academic Team honors. Aimee earned a Certificate from Harvard Business School in Sustainable Business Strategy.'),(3518,32,'_builder_1_two_columns_column_left','field_6398eb11fae34'),(3519,32,'builder_1_two_columns_column_right','<h2>Brooke Wurst</h2>\r\n<h3>Founder, Managing Director</h3>\r\nAfter founding the TRIAD Trust–an HIV/AIDS education and training NGO operating in remote regions of sub-Saharan Africa and Haiti–Brooke created RemoteID™, the first patented, secure, biometric-based mobile identity access management platform optimized for low-resource settings. In 2009, Brooke founded Remote Harbor to bring the RemoteID platform to scale at a population level for impact organizations. Since then, TRIAD’s programs have increased access to reproductive health and gender-based violence services to more than 60 million people around the world. And RemoteID-based solutions have increased secure access to health and social services and disaster management assistance to more than 25 million individuals. Brooke oversees Remote Harbor’s development of technology protocols and collaborative analysis plans for clients. Under her leadership, Remote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(3520,32,'_builder_1_two_columns_column_right','field_6398eb18fae35'),(3521,32,'builder_1_two_columns',''),(3522,32,'_builder_1_two_columns','field_6398eb09fae33'),(3523,161,'custom_css',''),(3524,161,'_custom_css','field_605cafca65108'),(3525,161,'builder_0_layout','Column Center'),(3526,161,'_builder_0_layout','field_6396a11a1ba71'),(3527,161,'builder_0_content_image_image_side','Right'),(3528,161,'_builder_0_content_image_image_side','field_6398d90ad974d'),(3529,161,'builder_0_content_image_style',''),(3530,161,'_builder_0_content_image_style','field_6396a2011ba75'),(3531,161,'builder_0_content_image_classes',''),(3532,161,'_builder_0_content_image_classes','field_6396a2101ba76'),(3533,161,'builder_0_content_image_content','<h2>Strategists for Good</h2>\r\n<h3>We think boldly about what’s possible</h3>\r\nRAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change.  We believe digital transformations will revolutionize society, and we’re here as your strategy and tech-for-good partner to drive progress further and faster.'),(3534,161,'_builder_0_content_image_content','field_6396a1f01ba73'),(3535,161,'builder_0_content_image_image',''),(3536,161,'_builder_0_content_image_image','field_6396a1fa1ba74'),(3537,161,'builder_0_content_image