ndent consultant and advisor for a variety of actors, ranging from agencies in the entertainment industry to small and medium-sized NGOs.\r\n\r\nAimee is a graduate of the University of Louisville, where she earned her degree in Political Science and Sports Business Administration. While there, she was a member of the Women\'s Lacrosse team and earned Big East All-Academic Team honors. Aimee earned a Certificate from Harvard Business School in Sustainable Business Strategy.'),(3620,162,'_builder_1_two_columns_column_left','field_6398eb11fae34'),(3621,162,'builder_1_two_columns_column_right','<h2>Brooke Wurst</h2>\r\n<h3>Founder, Managing Director</h3>\r\nAfter founding the TRIAD Trust–an HIV/AIDS education and training NGO operating in remote regions of sub-Saharan Africa and Haiti–Brooke created RemoteID™, the first patented, secure, biometric-based mobile identity access management platform optimized for low-resource settings. In 2009, Brooke founded Remote Harbor to bring the RemoteID platform to scale at a population level for impact organizations. Since then, TRIAD’s programs have increased access to reproductive health and gender-based violence services to more than 60 million people around the world. And RemoteID-based solutions have increased secure access to health and social services and disaster management assistance to more than 25 million individuals. Brooke oversees Remote Harbor’s development of technology protocols and collaborative analysis plans for clients. Under her leadership, Remote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(3622,162,'_builder_1_two_columns_column_right','field_6398eb18fae35'),(3623,162,'builder_1_two_columns',''),(3624,162,'_builder_1_two_columns','field_6398eb09fae33'),(3625,162,'builder_1_content_image_image_side','Right'),(3626,162,'_builder_1_content_image_image_side','field_6398d90ad974d'),(3627,162,'builder_1_content_image_style',''),(3628,162,'_builder_1_content_image_style','field_6396a2011ba75'),(3629,162,'builder_1_content_image_classes',''),(3630,162,'_builder_1_content_image_classes','field_6396a2101ba76'),(3631,162,'builder_1_content_image_content','<h2>Aimee Dixon</h2>\r\n<h3>Founder, Managing Director</h3>\r\nAimee is an experienced social sector professional working at the intersection of social and environmental impact and strategic philanthropy, both nationally and globally. With over a decade of philanthropic and private capital fundraising experience, she has worked in partnership with senior executive teams on strategic and growth planning, revenue generation, and business development. Aimee was most recently the Director of Philanthropy with World Lacrosse, an International Federation, where she built and led its first development office, directed a capital campaign, and advised a global sustainability working group. Aimee also serves as an independent consultant and advisor for a variety of actors, ranging from agencies in the entertainment industry to small and medium-sized NGOs.\r\n\r\nAimee is a graduate of the University of Louisville, where she earned her degree in Political Science and Sports Business Administration. While there, she was a member of the Women\'s Lacrosse team and earned Big East All-Academic Team honors. Aimee earned a Certificate from Harvard Business School in Sustainable Business Strategy.'),(3632,162,'_builder_1_content_image_content','field_6396a1f01ba73')