e','Right'),(5246,194,'_builder_3_content_image_image_side','field_6398d90ad974d'),(5247,194,'builder_3_content_image_style',''),(5248,194,'_builder_3_content_image_style','field_6396a2011ba75'),(5249,194,'builder_3_content_image_classes','bg-white'),(5250,194,'_builder_3_content_image_classes','field_6396a2101ba76'),(5251,194,'builder_3_content_image_content','<h2 class=\"\">Let’s grow together</h2>\r\nHave questions about your next growth move? Prophet has answers.\r\n[spacer class=\"\" style=\"\"]\r\n[gravityform id=\"2\" title=\"false\" description=\"false\" ajax=\"true\"]'),(5252,194,'_builder_3_content_image_content','field_6396a1f01ba73'),(5253,194,'builder_3_content_image_image','128'),(5254,194,'_builder_3_content_image_image','field_6396a1fa1ba74'),(5255,194,'builder_3_content_image',''),(5256,194,'_builder_3_content_image','field_6396a1591ba72'),(5257,32,'builder_0_columns_group_classes',''),(5258,32,'_builder_0_columns_group_classes','field_63cdff317cfb1_field_63c58e1babc15'),(5259,32,'builder_0_columns_group_style','background:#EEEBFF;'),(5260,32,'_builder_0_columns_group_style','field_63cdff317cfb1_field_63c58e07abc14'),(5261,32,'builder_0_columns_group_id',''),(5262,32,'_builder_0_columns_group_id','field_63cdff317cfb1_field_63c58f5259e75'),(5263,32,'builder_0_columns_group_columns_repeater_0_column_classes','col-lg-6'),(5264,32,'_builder_0_columns_group_columns_repeater_0_column_classes','field_63c5eb1639ad4'),(5265,32,'builder_0_columns_group_columns_repeater_0_content','<h2>Aimee Dixon</h2>\r\n<h3>Founder, Managing Director</h3>'),(5266,32,'_builder_0_columns_group_columns_repeater_0_content','field_63c5eb2039ad5'),(5267,32,'builder_0_columns_group_columns_repeater_0_accordions_0_title','Read Bio'),(5268,32,'_builder_0_columns_group_columns_repeater_0_accordions_0_title','field_63cdffbf7cfb3'),(5269,32,'builder_0_columns_group_columns_repeater_0_accordions_0_content','Aimee is an experienced social sector professional working at the intersection of social and environmental impact and strategic philanthropy, both nationally and globally. With over a decade of philanthropic and private capital fundraising experience, she has worked in partnership with senior executive teams on strategic and growth planning, revenue generation, and business development. Aimee was most recently the Director of Philanthropy with World Lacrosse, an International Federation, where she built and led its first development office, directed a capital campaign, and advised a global sustainability working group. Aimee also serves as an independent consultant and advisor for a variety of actors, ranging from agencies in the entertainment industry to small and medium-sized NGOs.\r\n\r\nAimee is a graduate of the University of Louisville, where she earned her degree in Political Science and Sports Business Administration. While there, she was a member of the Women’s Lacrosse team and earned Big East All-Academic Team honors. Aimee earned a Certificate from Harvard Business School in Sustainable Business Strategy.'),(5270,32,'_builder_0_columns_group_columns_repeater_0_accordions_0_content','field_63cdffc57cfb4'),(5271,32,'builder_0_columns_group_columns_repeater_0_accordions','1'),(5272,32,'_builder_0_columns_group_columns_repeater_0_accordions','field_63cdffa37cfb2'),(5273,32,'builder_0_columns_group_columns_repeater_1_column_classes','col-lg-6'),(5274,32,'_builder_0_columns_group_columns_repeater_1_column_classes','field_63c5eb1639ad4'),(5275,32,'builder_0_columns_group_columns_repeater_1_content','<h2>Brooke Wurst</h2>\r\n<h3>Founder, Managing Director</h3>'),(5276,32,'_builder_0_columns_group_columns_repeater_1_content','field_63c5eb2039ad5'),(5277,32,'builder_0_columns_group_columns_repeater_1_accordions_0_title','Read bio'),(5278,32,'_builder_0_columns_group_columns_repeater_1_accordions_0_title','field_63cdffbf7cfb3'),(5279,32,'builder_0_columns_group_columns_repeater_1_accordions_0_content','After founding the TRIAD Trust–an HIV/AIDS education and training NGO operating in remote regions of sub-Saharan Africa and Haiti–Brooke created RemoteID™, the first patented, secure, biometric-based mobile identity access management platform optimized for low-resource settings. In 2009, Brooke founded Remote Harbor to bring the RemoteID platform to scale at a population level for impact organizations. Since then, TRIAD’s programs have increased access to reproductive health and gender-based violence services to more than 60 million people around the world. And RemoteID-based solutions have increased secure access to health and social services and disaster management assistance to more than 25 million individuals. Brooke oversees Remote Harbor’s development of technology protocols and collaborative analysis plans for clients. Under her leadership, Remote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(5280,32,'_builder_0_columns_group_columns_repeater_1_accordions_0_content','field_63cdffc57cfb4'),(5281,32,'builder_0_columns_group_columns_repeater_1_accordions','1'),(5282,32,'_builder_0_columns_group_columns_repeater_1_accordions','field_63cdffa37cfb2'),(5283,32,'builder_0_columns_group_columns_repeater','2'),(5284,32,'_builder_0_columns_group_columns_repeater','field_63c5eb0839ad3'),(5285,32,'builder_0_columns_group',''),(5286,32,'_builder_0_columns_group','field_63c5eae539ad2'),(5287,32,'builder_1_column_center_style',''),(5288,