ionally and globally. With over a decade of philanthropic and private capital fundraising experience, she has worked in partnership with senior executive teams on strategic and growth planning, revenue generation, and business development. Aimee was most recently the Director of Philanthropy with World Lacrosse, an International Federation, where she built and led its first development office, directed a capital campaign, and advised a global sustainability working group. Aimee also serves as an independent consultant and advisor for a variety of actors, ranging from agencies in the entertainment industry to small and medium-sized NGOs.\r\n\r\nAimee is a graduate of the University of Louisville, where she earned her degree in Political Science and Sports Business Administration. While there, she was a member of the Women’s Lacrosse team and earned Big East All-Academic Team honors. Aimee earned a Certificate from Harvard Business School in Sustainable Business Strategy.'),(5390,206,'_builder_0_columns_group_columns_repeater_0_accordions_0_content','field_63cdffc57cfb4'),(5391,206,'builder_0_columns_group_columns_repeater_0_accordions','1'),(5392,206,'_builder_0_columns_group_columns_repeater_0_accordions','field_63cdffa37cfb2'),(5393,206,'builder_0_columns_group_columns_repeater_1_column_classes','col-lg-6'),(5394,206,'_builder_0_columns_group_columns_repeater_1_column_classes','field_63c5eb1639ad4'),(5395,206,'builder_0_columns_group_columns_repeater_1_content','<h2>Brooke Wurst</h2>\r\n<h3>Founder, Managing Director</h3>'),(5396,206,'_builder_0_columns_group_columns_repeater_1_content','field_63c5eb2039ad5'),(5397,206,'builder_0_columns_group_columns_repeater_1_accordions_0_title','Read bio'),(5398,206,'_builder_0_columns_group_columns_repeater_1_accordions_0_title','field_63cdffbf7cfb3'),(5399,206,'builder_0_columns_group_columns_repeater_1_accordions_0_content','After founding the TRIAD Trust–an HIV/AIDS education and training NGO operating in remote regions of sub-Saharan Africa and Haiti–Brooke created RemoteID™, the first patented, secure, biometric-based mobile identity access management platform optimized for low-resource settings. In 2009, Brooke founded Remote Harbor to bring the RemoteID platform to scale at a population level for impact organizations. Since then, TRIAD’s programs have increased access to reproductive health and gender-based violence services to more than 60 million people around the world. And RemoteID-based solutions have increased secure access to health and social services and disaster management assistance to more than 25 million individuals. Brooke oversees Remote Harbor’s development of technology protocols and collaborative analysis plans for clients. Under her leadership, Remote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(5400,206,'_builder_0_columns_group_columns_repeater_1_accordions_0_content','field_63cdffc57cfb4'),(5401,206,'builder_0_columns_group_columns_repeater_1_accordions','1'),(5402,206,'_builder_0_columns_group_columns_repeater_1_accordions','field_63cdffa37cfb2'),(5403,206,'builder_0_columns_group_columns_repeater','2'),(5404,206,'_builder_0_columns_group_columns_repeater','field_63c5eb0839ad3'),(5405,206,'builder_0_columns_group',''),(5406,206,'_builder_0_columns_group','field_63c5eae539ad2'),(5407,206,'builder_1_column_center_style',''),(5408,206,'_builder_1_column_center_style','field_6396a7a