ysis plans for clients. Under her leadership, Remote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(5428,206,'_builder_3_content_image_content','field_6396a1f01ba73'),(5429,206,'builder_3_content_image_image','86'),(5430,206,'_builder_3_content_image_image','field_6396a1fa1ba74'),(5431,206,'builder_3_content_image',''),(5432,206,'_builder_3_content_image','field_6396a1591ba72'),(5433,207,'custom_css',''),(5434,207,'_custom_css','field_605cafca65108'),(5435,207,'builder_0_layout','Columns'),(5436,207,'_builder_0_layout','field_6396a11a1ba71'),(5437,207,'builder_0_content_image_image_side','Right'),(5438,207,'_builder_0_content_image_image_side','field_6398d90ad974d'),(5439,207,'builder_0_content_image_style',''),(5440,207,'_builder_0_content_image_style','field_6396a2011ba75'),(5441,207,'builder_0_content_image_classes',''),(5442,207,'_builder_0_content_image_classes','field_6396a2101ba76'),(5443,207,'builder_0_content_image_content','<h2>Strategists for Good</h2>\r\n<h3>We think boldly about what’s possible</h3>\r\nRAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change.  We believe digital transformations will revolutionize society, and we’re here as your strategy and tech-for-good partner to drive progress further and faster.'),(5444,207,'_builder_0_content_image_content','field_6396a1f01ba73'),(5445,207,'builder_0_content_image_image',''),(5446,207,'_builder_0_content_image_image','field_6396a1fa1ba74'),(5447,207,'builder_0_content_image',''),(5448,207,'_builder_0_content_image','field_6396a1591ba72'),(5449,207,'builder','4'),(5450,207,'_builder','field_6396a0f51ba70'),(5451,207,'header_subtitle','We think boldly about what’s possible'),(5452,207,'_header_subtitle','field_63c5e6b00a2e4'),(5453,207,'header_content','RAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change. We believe digital transformations will revolutionize society, and we’re here as your strategy and tech-for-good partner to drive progress further and faster.'),(5454,207,'_header_content','field_63c5e6b90a2e5'),(5455,207,'builder_0_column_center_style',''),(5456,207,'_builder_0_column_center_style','field_6396a7ab816bd'),(5457,207,'builder_0_column_center_classes',''),(5458,207,'_builder_0_column_center_classes','field_6396a7b5816be'),(5459,207,'builder_0_column_center_content','<h2>Executive Leadership</h2>'),(5460,207,'_builder_0_column_center_content','field_6396a741cad9c'),(5461,207,'builder_0_column_center',''),(5462,207,'_builder_0_column_center','field_6396a732cad9b'),(5463,207,'builder_1_layout','Column Center'),(5464,207,'_builder_1_layout','field_6396a11a1ba71'),(5465,207,'builder_1_two_columns_column_left','<h2>Aimee Dixon</h2>\r\n<h3>Founder, Managing Director</h3>\r\nAimee is an experienced social sector professional working at the intersecti