oteID™, the first patented, secure, biometric-based mobile identity access management platform optimized for low-resource settings. In 2009, Brooke founded Remote Harbor to bring the RemoteID platform to scale at a population level for impact organizations. Since then, TRIAD’s programs have increased access to reproductive health and gender-based violence services to more than 60 million people around the world. And RemoteID-based solutions have increased secure access to health and social services and disaster management assistance to more than 25 million individuals. Brooke oversees Remote Harbor’s development of technology protocols and collaborative analysis plans for clients. Under her leadership, Remote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(5880,210,'_builder_0_columns_group_columns_repeater_1_accordions_0_content','field_63cdffc57cfb4'),(5881,210,'builder_0_columns_group_columns_repeater_1_accordions','1'),(5882,210,'_builder_0_columns_group_columns_repeater_1_accordions','field_63cdffa37cfb2'),(5883,210,'builder_0_columns_group_columns_repeater','2'),(5884,210,'_builder_0_columns_group_columns_repeater','field_63c5eb0839ad3'),(5885,210,'builder_0_columns_group',''),(5886,210,'_builder_0_columns_group','field_63c5eae539ad2'),(5887,210,'builder_1_column_center_style',''),(5888,210,'_builder_1_column_center_style','field_6396a7ab816bd'),(5889,210,'builder_1_column_center_cla