emote Harbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(5908,210,'_builder_3_content_image_content','field_6396a1f01ba73'),(5909,210,'builder_3_content_image_image','86'),(5910,210,'_builder_3_content_image_image','field_6396a1fa1ba74'),(5911,210,'builder_3_content_image',''),(5912,210,'_builder_3_content_image','field_6396a1591ba72'),(5913,216,'custom_css',''),(5914,216,'_custom_css','field_605cafca65108'),(5915,216,'builder_0_layout','Columns'),(5916,216,'_builder_0_layout','field_6396a11a1ba71'),(5917,216,'builder_0_content_image_image_side','Right'),(5918,216,'_builder_0_content_image_image_side','field_6398d90ad974d'),(5919,216,'builder_0_content_image_style',''),(5920,216,'_builder_0_content_image_style','field_6396a2011ba75'),(5921,216,'builder_0_content_image_classes',''),(5922,216,'_builder_0_content_image_classes','field_6396a2101ba76'),(5923,216,'builder_0_content_image_content','<h2>Strategists for Good</h2>\r\n<h3>We think boldly about what’s possible</h3>\r\nRAIS3 is a team with blended, deep expertise spanning the impact sector with nearly 40 years of combined experience in developing strategy and technology solutions. We bring together partners and industry experts to drive new approaches to accelerate impact. We specialize in leveraging new and emerging digital technologies with the power to unlock transformational change.  We believe digital transformations will revolutioni