arbor developed an equity-focused social impact and social entrepreneurship model with grantmaking and distributing free licenses to small non-profit organizations.\r\n\r\nBrooke earned an MS from Northwestern University. She studied Literature as a graduate student at Harvard University and earned a specialization certificate in Business Strategy from the Darden School of Business at the University of Virginia, holds a certificate in Impact Measurement and Management for the SDGs from the Fuqua School of Business at Duke University and nabbed her BA with honors in Comparative Literature from the University of Pennsylvania.'),(6028,216,'_builder_3_content_image_content','field_6396a1f01ba73'),(6029,216,'builder_3_content_image_image','86'),(6030,216,'_builder_3_content_image_image','field_6396a1fa1ba74'),(6031,216,'builder_3_content_image',''),(6032,216,'_builder_3_content_image','field_6396a1591ba72'),(6033,2,'builder_0_two_columns_classes',''),(6034,2,'_builder_0_two_columns_classes','field_63ce0c24b41ca_field_63c58e1babc15'),(6035,2,'builder_0_two_columns_style',''),(6036,2,'_builder_0_two_columns_style','field_63ce0c24b41ca_field_63c58e07abc14'),(6037,2,'builder_0_two_columns_id',''),(6038,2,'_builder_0_two_columns_id','field_63ce0c24b41ca_field_63c58f5259e75'),(6039,2,'builder_1_case_studies_classes',''),(6040,2,'_builder_1_case_studies_classes','field_63ce0b4fb41c9_field_63c58e1babc15'),(6041,2,'builder_1_case_studies_style',''),(6042,2,'_builder_1_case_studies_style','field_63ce0b4fb41c9_field_63c58e07abc14'),(6043,2,'builder_1_case_studies_id',''),(6044,2,'_builder_1_case_studies_id','field_63ce0b4fb41c9_field_63c58f5259e75'),(6045,2,'builder_2_gallery_classes',''),(6046,2,'_builder_2_gallery_classes','field_63ce0c55b41cb_field_63c58e1babc15'),(6047,2,'builder_2_gallery_style',''),(6048,2,'_builder_2_gallery_style','field_63ce0c55b41cb_field_63c58e07abc14'),(6049,2,'builder_2_gallery_id',''),(6050,2,'_builder_2_gallery_id','field_63ce0c55b41cb_field_63c58f52